import PopupWithForm from "./PopupWithForm";


function CardDeletePopup (props) {

    function handleSubmit (evt) {
        evt.preventDefault()
    }

    return (
        <PopupWithForm
            name={"card-delete"}
            title={"Вы уверены?"}
            isOpen={props.isOpen}
            onClose={props.onClose}
            onSubmit={handleSubmit}
            buttonText={"Да"}
        >
        </PopupWithForm>
    )
}

export default CardDeletePopup;
